import React from 'react'
import { Typography, Card, CardContent } from '@material-ui/core'
import './Message.css';
function Message(props) {
    return (
         <Card className="message__card">
         <CardContent>
        <Typography
           color="White"
           variant="h5"
           component="h2"
        >
           {props.username} : {props.text}

        </Typography>
        </CardContent>
        </Card>
    )
}

export default Message
